import React from "react";
import "./MenuEmGrupo.css";
import compartilhar from "../assets/compartilhar.jpg";

const MenuEmGrupo = () => {
  return (
    <div>
      <h1>Shared Table</h1>

      <div className="menugrupo-content">

        <div className="img-menugrupo">
          <img src={compartilhar} alt="amigos comendo juntos" />
        </div>
        <div className="menugrupo-description">
          <p>
            Nossa equipe é liderada por uma chef talentosa e experiente, que
            traz ao Maison Nordic uma visão única e inovadora da culinária. Com
            uma trajetória internacional, expertise e criatividade, explora
            cozinhas ao redor do mundo, trazendo para o restaurante a
            autenticidade dos sabores nórdicos e a sofisticação da gastronomia
            francesa. Sempre aberta a novas experiências e técnicas, ela combina
            ingredientes frescos e inusitados, transformando cada prato em uma
            descoberta.
          </p>
        </div>
      </div>
    </div>
  );
};

export default MenuEmGrupo;
